import styled from 'styled-components';

export default styled.a`
  background-image: url('/static/images/routrid-transparent.png');
  background-size: contain;
  background-repeat: no-repeat;
  padding: 25px 50px;
  background-position: left;
  margin-left: 5px;
`;
